import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Container, Row, Col } from 'reactstrap';


const useStyles = makeStyles((theme) => ({
    skillTitle: {

      fontSize:"26px",
      padding:"2rem",
      textAlign:"center",
      color:"white",
    },
    background:{
        backgroundColor:"#233",
    },
    AllTextCenter:{
        textAlign:"center",

    },
    flexAligh:{
        color:"white",
        display:"flex",
        flexDirection:"row",
    },
    skillItems:{
        borderBottom:"1px solid red",
        marginBottom:"50px",
        paddingBottom:"50px",
    },
    skillBar:{
        width:"70%",
        height:"6px",
        borderRadius:"3px",
        backgroundColor:"rgba(250,250,250,0.25)",
        position:"relative",
    },
    filledBar:{

    }

  }));


const Skills = () => {

const classes = useStyles();

    return (
        <Container className={classes.background}>
                <Row className={classes.skillTitle}><h2>My Skills</h2></Row>
           <Row class={classes.AllTextCenter}>

                <Row className={classes.flexAligh}>
                    <Col className={classes.skillItems}>
                      <h3>HTML5 / CSS3</h3>
                      <div className={classes.skillBar}>
                            <span>95%</span>
                            <div className={classes.filledBar}></div>
                     </div>   
                    </Col>
                    <Col className={classes.skillItems}>
                      <h3>Bootstrap</h3>

                    </Col>
                </Row>      

           </Row>   
        </Container>                        

    );
  };
  export default Skills;
